function FooterMenu() {
  return (
    <div className="footerMenu">
      <ul>
        <li className="footer-text">Параметры</li>
        <li className="footer-text">Разработчикам</li>
        <li className="footer-text">Вакансии</li>
        <li className="last-footer">Все права защищены.</li>
      </ul>
    </div>
  );
}
export default FooterMenu;
